from app.mktcore.mdlimports import *

class MKT_OVERDRAFT_CONTRACT(exmodel):
	ID 					= 	db.Column(db.String(14), primary_key=True, index=True)
	CustomerID 			= 	db.Column(db.String(12))
	Account				= 	db.Column(db.String(14))
	Currency 			=	db.Column(db.String(3))
	AccProduct 			=	db.Column(db.String(10))
	Category			=	db.Column(db.String(10))
	ValueDate 			=	db.Column(db.String(10))
	Term 				= 	db.Column(db.String(5))
	MaturityDate		=	db.Column(db.String(10))
	LimitedAmount 		=	db.Column(db.Numeric(25, 9))
	InterestRate 		=	db.Column(db.String(5))
	IntCapitalize		=	db.Column(db.String(1))
	AccountType			=	db.Column(db.String(1))
	Suspend				=	db.Column(db.String(1))
	AssetClass			=	db.Column(db.String(8))
	NumDayDue			= 	db.Column(db.String(5))
	OfficerID 			= 	db.Column(db.String(10))
	Collateral 			= 	db.Column(db.String(14))
	NextRunDate			=	db.Column(db.String(10))
	Accrual				=	db.Column(db.String(1))
	IntIncEarned		=	db.Column(db.Numeric(25, 9))
	AccrInterest 		= 	db.Column(db.Numeric(25, 9))
	AccrIntPerDay		=	db.Column(db.Numeric(25, 9))
	AccrIntCurrMonth 	=	db.Column(db.Numeric(25, 9))
	AccrIntPreMonth 	= 	db.Column(db.Numeric(25, 9))
	CapitalizedAmount	=	db.Column(db.Numeric(25, 9))
	OffBalanceSheet 	=	db.Column(db.Numeric(25, 9))
	OutstandingAmount 	=	db.Column(db.Numeric(25, 9))
	
